import React from "react";

function Nav({ setTheme }) {
  // let theme = getActiveTheme();
  // console.log("props", props);
  return (
    <div className="navbar">
      <div className="nav-link">Portfolio</div>
      <div className="nav-link">Portfolio</div>
      <div className="nav-link">DataViz</div>
      <button className="sunlight-nighttime ml-auto" onClick={e => setTheme()}>
        <div className="sun"></div> <div className="night"></div>
        Theme
      </button>
    </div>
  );
}

export default Nav;
